import React from 'react';

function Home(props) {
    return(
      <div className="container">
        <div className="row align-items-start">
            <div className="col-12 col-md m-1">
                <RenderCard item={props.dish} />
            </div>
        </div>
      </div>
    );
}

export default Home;
